Category	Feature, Foreign, Couples, Sweet Sinner's Exchange Student Series

Director	James Avalon
Starring	Dana DeArmond, Evan Stone, Alec Knight, Tiffany Doll

Featuring Tiffany Doll! Real Love Making, Real Orgasms! They Opened Their Home, She Opened Their Marriage! Ben's (Evan Stone) been kicked out of his house because of his affair with an exchange student, so imagine his surprise when his buddy Alex (Alec Knight) and his wife Dana (Dana DeArmond) are taking in an exchange student of their own. Old habits die hard as new passions are born, swirling around the sumptuous French student, Tiffany (Tiffany Doll). Sweet Sinner invites you into the home of struggling marriages and devious infidelity. Directed by James Avalon.

